import React from "react";
import "./Pages.css";

const Privacy = () => {
  return (
    <div className="page">
      <h2>Privacy Policy</h2>
      <p>
        Your privacy is important to us. Blog App ensures that your personal
        data is protected and not shared with third parties without consent.
      </p>
    </div>
  );
};

export default Privacy;
